import LayoutDefault from "../layout/LayoutDefault";
import Introduce from "../pages/introduce";
import Login from "../pages/login";
import Register from "../pages/register";
import Home from "../pages/Home";
import LayoutHome from "../layout/LayoutHome";

export const routes = [
    {
        path: "/",
        element: <LayoutDefault />,
        children: [
            {
                path: "/",
                element: <Introduce />
            },
            {
                path: "login",  // Đường dẫn tương đối
                element: <Login />
            },
            {
                path: "register",  // Đường dẫn tương đối
                element: <Register />
            },
            {
                path: "home",  // Đường dẫn tương đối
                element: <LayoutHome />,
                children: [
                    {
                        path: "",  // Đường dẫn trống để chỉ định route mặc định
                        element: <Home />
                    }
                ]
            }
        ]
    }
];
